import { Link } from 'react-router-dom';
import styled from 'styled-components';

const Header = styled.div`
  display: flex;
  padding: 16px;
  -webkit-box-pack: justify;
  justify-content: space-between;
  -webkit-box-align: center;
  align-items: center;
  width: 100%;
  background: rgb(51, 51, 51);
  color: white;
`;

const Gihtubviewer = styled.h1`
  white-space: nowrap;
  color: white;
`;

function App() {
  return (
    <div className="App">
      <Header>
        <nav>
          <ul>
            <li>
              <Link to="/">
                <Gihtubviewer>Gihtubviewer</Gihtubviewer>
              </Link>
            </li>
          </ul>
        </nav>
      </Header>
    </div>
  );
}

export default App;
